import "./App.css";
import LoginPages from "./pages/LoginPages";
import disneyLogo from "./disneyLogo.png";
function App() {
  return (
    <div className="App">
      <LoginPages>
        <img src={disneyLogo.png} />
      </LoginPages>
    </div>
  );
}

export default App;
